@tech_jenn @Only_WomenBleed That’s what I have been saying.  

It’s frightening that people can even say things like this and have some people agree with them.  

Some people have lost their grip.   This is important to watch out for.  It’s a change in what’s acceptable.  Rage is building.  Beware of it.

@Avengedblizzard “Sadness?” That earned a little chuckle from the female, her eyes rolling.

“Maybe rage, would be a better fit.” She carefully accepted the cigarette and lifted it to her lips, though it really didn’t do much for her.

“Callie, nice to meet ya Rick.”
